import React from 'react';
import './Menu.sass'
import PathfindingVisualizer from './PathfindingVisualizer/PathfindingVisualizer.jsx';

function visualizeAlgorithm(props,value) {
    let moves = []
    switch(value) {
      case 1:
        moves = backtracking(this.state.grid)
        visualizeBacktracking(moves)
        document.getElementById('button').innerHTML = "Visualize Backtracking"
        break

    //   case 1:
    //     moves = backtracking(this.state.grid)
    //     visualizeBacktracking(moves)
    //     break
      
    //   case 2:
    //     moves = simulatedAnnealing(this.state.grid)
    //     setTimeout(visualizeSimulatedAnnealing(moves),1000)
    //     break
      
      default:
        console.log("You selected an algorithm!")
        break
    }
  }

export default function Menu(props) {
    return (
        <nav class="menu">
            <ol>
                <li class="menu-item"><a href="#0">About</a></li>
                <li class="menu-item">
                    <a href="#0">Algorithm</a>
                    <ol class="sub-menu">
                        <li class="menu-item" onClick={() => visualizeAlgorithm(props,1)}>Backtracking</li>
                        <li class="menu-item"><a href="#0">Simulated Annealing</a></li>
                        <li class="menu-item"><a href="#0">Huge Dicks</a></li>
                    </ol>
                </li>
                <button
                    id='button'
                    onClick={() => {/*FIXME put visualize algorithm function here*/ }}
                    href="#" 
                    className="myButton"
                    >
                    Visualize Algorithm
                </button>
                <li class="menu-item">
                <a href="#0">Kabobs</a>
                <ol class="sub-menu">
                    <li class="menu-item"><a href="#0">Shishkabobs</a></li>
                    <li class="menu-item"><a href="#0">BBQ kabobs</a></li>
                    <li class="menu-item"><a href="#0">Summer kabobs</a></li>
                </ol>
                </li>
                <li class="menu-item"><a href="#0">Contact</a></li>
            </ol>
        </nav>
    )
}
